import { Link } from "react-router-dom";
import LogoSVG from "../components/Logo/LogoSVG";

import {
  Wrapper,
  Logo,
  Container,
  Title,
  Buttons,
} from "../styles/mainGuest.styled";

const MainGuest = () => {
  return (
    <Wrapper>
      <Logo>
        <LogoSVG />
      </Logo>
      <Container>
        <Title>
          <span>드라마, 예능, 영화, 스포츠를 한번에!</span>
          <br /> <span>지금 시작하세요!!! </span>MOVING!
        </Title>
        <Buttons>
          <Link to={"/login"}>로그인</Link>
          <Link to={"/signup"}>회원가입</Link>
        </Buttons>
      </Container>
    </Wrapper>
  );
};

export default MainGuest;
